<style>

rgin:20ex auto 2ex auto}#login-form .box-inner{width:430px;background:-webkit-gradient(linear,left top,left bottom,color-stop(0,#404040),color-stop(100%,#2e2e2e));background:-ms-linear-gradient(top,#404040 0,#2e2e2e 100%);background:linear-gradient(to bottom,#404040 0,#2e2e2e 100%);margin:0 50px;padding:10px 24px 24px 24px;border-radius:6px}#login-form .box-bottom{margin-top:-3px;padding-top:10px}#login-form td.input{width:80%;padding:8px}#login-form input[type="text"],#login-form input[type="password"]{width:100%;border-color:#666}#login-form button.button{color:#444;border-color:#f9f9f9;background-color:#f9f9f9}#login-form button.button:active{color:#333;background-color:#dcdcdc}#login-form form table{width:98%}#login-form td.title{width:20%;white-space:nowrap;color:#cecece;text-align:right;padding-right:1em}#login-form p.formbuttons{margin-top:2em;text-align:center}#login-form #logo{margin-bottom:20px;border:0}#login-form #message{min-height:40px;padding:5px 25px;text-align:center;font-size:1.1em}#bottomline{font-size:90%;text-align:center;margin-top:2em}
